import { Router, Routes } from 'react-router';
import './App.css';
import Card from './cards/card';

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route exact path="/" element={<Home />}></Route>
        </Routes>
      </Router>
      <Card />
    </div>
  );
}

export default App;
